import os
import django
from random import choice, randint
from django.core.files.base import ContentFile
from django.core.files.storage import default_storage

# Set up Django environment
import requests
os.environ.setdefault("DJANGO_SETTINGS_MODULE", "restaurant_api.settings")
django.setup()

# Import the model from the correct app
from restaurant_app.models import FoodItem

# Initialize a list of categories for food items
categories = ["Appetizer", "Main Course", "Dessert", "Beverage"]

# Helper function to download and save an image from a URL
def download_image(image_url, save_path):
    try:
        response = requests.get(image_url)
        response.raise_for_status()  # Check for HTTP errors
        image_content = response.content
        image_name = os.path.basename(save_path)
        image_file = ContentFile(image_content)
        
        # Save the image to the specified path
        with default_storage.open(save_path, 'wb') as f:
            f.write(image_file.read())
        return save_path
    except requests.exceptions.RequestException as e:
        print(f"Error downloading image: {e}")
        return None

# Helper function to create food items from the combined data
def create_food_item(name, description, image_url):
    price = round(randint(5, 30) + randint(0, 99) / 100, 2)
    category = choice(categories)
    is_available = choice([True, False])

    # If an image URL is provided, download and save it
    if image_url:
        downloaded_food_dir = os.path.join(os.getcwd(), 'media', 'downloaded_food')
        if not os.path.exists(downloaded_food_dir):
            os.makedirs(downloaded_food_dir)

        image_path = f"downloaded_food/{name}_{randint(1, 1000)}.jpg"
        downloaded_image = download_image(image_url, image_path)
    else:
        downloaded_image = None

    # Create and return a FoodItem instance
    return FoodItem(
        name=name,
        description=description,
        price=price,
        category=category,
        is_available=is_available,
        image=downloaded_image  # Assign the local image path if available
    )

