# Combine the lists into a tuple for processing
combined = tuple(zip(names, descriptions, imgs))

# Populate the database with food items
def populate_data_from_combined():
    for food_item_data in combined:
        name, description, image_url = food_item_data
        food_item = create_food_item(name, description, image_url)
        if food_item:
            food_item.save()
            print(f"Food item {food_item.name} added successfully.")
        else:
            print(f"Failed to create food item {name} due to image download error.")

# Run the function to populate data from the combined tuple
if __name__ == "__main__":
    populate_data_from_combined()
